package week1.day2;

public class FindOddNumbers {

	public static void main(String[] args)  {
		// TODO Auto-generated method stub
		int num1 = 10;
		
		for(int i = 1 ; i<= num1; i++)
		{
			
			if (i%2 != 0)
			{
				System.out.println("The Odd Number is :" + i);

			}
		}

	}

}

